import { instanceAxs } from "../api/Api"

export const signIn = (user) => {
    return{
        type: "SIGN_IN",
        payload: user
    }
}


export const signOut = () => {
    return{
        type: "SIGN_OUT"
    }
}

function complexSynchronousThunk(someValue) {
    return (dispatch, getState) => {
      dispatch(someBasicActionCreator(someValue))
      dispatch(someThunkActionCreator())
    }
}

export const fetchTodoById = (user) => async (dispatch, getState) => {
    const response = await instanceAxs.post('/login', user);
    if(response === "user logged in"){
        dispatch()
    }
}
